import SearchForm from "../Movies/SearchForm/SearchForm";
import SavedMovie from "./SavedMovie/SavedMovie";

const SavedMovies = () => {
  return (
    <ul className="movies-list">
      <SearchForm />
      <SavedMovie />
    </ul>
  );
};

export default SavedMovies;
